import React from "react";

function nav() {
  return (
    <div>
      <ul className="home-ul">
        <li className="home-li">
          <h1>Home</h1>
        </li>
        <li className="home-li">
          <h1>Add User</h1>
        </li>
        <li className="home-li">
          <h1>User Details</h1>
        </li>
      </ul>
    </div>
  );
}

export default nav;
